#define N 25//the size of matrix
 
/*
* Calculate previous x using the x that has been calculated
* float a[][]   matrix U
* float x[]     the solutions of the equations 
* int   i       index of the solutions
* int   n       matrix size
* return        the sum of matrix you want 
*/
float getmx(float a[N][N], float x[N], int i, int n)
{
    float mx = 0;
    int r;
    for(r=i+1; r<n; r++)
    {
        mx += a[i][r] * x[r];
    }
    return mx;
}
 
/*
* Calculate the previous y using the y has calculated
* float a[][]   matrix L
* float y[]     arrat Y
* int   i       index of array Y
* int   n       matrix size
* return        the sum of matrix you want 
*/
float getmy(float a[N][N], float y[N], int i, int n)
{
    float my = 0;
    int r;
    for(r=0; r<n; r++)
    {
        if(i != r) my += a[i][r] * y[r];
    }
    return my;
}
 
/*
* solve the equations，calculate x
* float a[][]   matrix U
* float x[]     the solutions of the equations 
* int   i       the id of the solutions
* int   n       matrix size
* return        num i solution of the whole results
*/
float getx(float a[N][N], float b[N], float x[N], int i, int n)
{
    float result;
 
    if(i==n-1) //calculate the last x value
        result = (float)(b[i]/a[n-1][n-1]);
    else //calculate the others x values 
        result = (float)((b[i]-getmx(a,x,i,n))/a[i][i]);
 
    return result;
}
 
/*
* calculate the array Y, get some element value in it
* float a[][]   matrix L
* float y[]     array Y
* int   i       array Y's element index
* int   n       the size of the matrix
* return        array Y's #i element value
*/
float gety(float a[N][N], float b[N], float y[N], int i, int n)
{
    float result;
 
    if(i==0) //calculate the first y value
        result = float(b[i]/a[i][i]);
    else //calculate the others y values 
        result = float((b[i]-getmy(a,y,i,n))/a[i][i]);
 
    return result;
}
 
